object.script:
bool={}
function onTick() go=input.getBool(32) if go then for i=1, 6 do bool[i]=input.getBool(i) end end end
function onDraw() w=screen.getWidth() h=screen.getHeight() a=h/2 b=w/2 screen.drawTextBox(0, 2, w, 7, "Landing Gear", 0, -1)
screen.drawTextBox(b-9, a-16, 20, 7, "NOSE", 0, -1) screen.drawLine(b-3, a-2, b+4, a-2) screen.drawLine(b-3, a-10, b+4, a-10) screen.drawLine(b-4, a-3, b-4, a-10) screen.drawLine(b+4, a-3, b+4, a-10) if bool[4] then screen.setColor(0, 255, 0) elseif bool[3] then screen.setColor(10, 10, 10) else screen.setColor(255, 0, 0) end screen.drawRectF(b-3, a-8.5, 7, 7) screen.setColor(255, 255, 255)
screen.drawTextBox(b-26, a+12, 25, 7, "Left", 0, -1) screen.drawTextBox(b-26, a+18, 25, 7, "Main", 0, -1) screen.drawLine(b-9, a+2, b-2, a+2) screen.drawLine(b-9, a+10, b-2, a+10) screen.drawLine(b-10, a+3, b-10, a+10) screen.drawLine(b-2, a+3, b-2, a+10) if bool[2] then screen.setColor(0, 255, 0) elseif bool[1] then screen.setColor(10, 10, 10) else screen.setColor(255, 0, 0) end screen.drawRectF(b-9, a+3.5, 7, 7) screen.setColor(255, 255, 255)
screen.drawTextBox(b+3, a+12, 25, 7, "Right", 0, -1) screen.drawTextBox(b+2, a+18, 25, 7, "Main", 0, -1) screen.drawLine(b+9, a+2, b+2, a+2) screen.drawLine(b+9, a+10, b+2, a+10) screen.drawLine(b+10, a+3, b+10, a+10) screen.drawLine(b+2, a+3, b+2, a+10) if bool[6] then screen.setColor(0, 255, 0) elseif bool[5] then screen.setColor(10, 10, 10) else screen.setColor(255, 0, 0) end screen.drawRectF(b+3, a+3.5, 7, 7) screen.setColor(255, 255, 255) end

btn={} eng={} engn=property.getNumber("Number of Engines") for i=1, engn do table.insert(eng, #eng+1, true) end btnx={} btny={} btnw={} btnh={}
function onTick() go=input.getBool(32) if go then w=input.getNumber(1) h=input.getNumber(2) a=h/2 b=w/2 touchX=input.getNumber(3) -- touchscreen pixel coords touchY=input.getNumber(4) press=input.getBool(1) if press then -- pulses the screen press to prevent flickering if x==0 then pulse=true x=1 else pulse=false end else x=0 pulse=false end cx={cx1, cx2, cx3, cx4} cy={cy1, cy2, cy3, cy4} lf=w/4 rt=3*w/4 tp=h/4 bt=3*h/4 if eng[4] then -- defines center points for each engine cx[1]=lf cx[2]=rt cx[3]=lf cx[4]=rt cy[1]=tp cy[2]=tp cy[3]=bt cy[4]=bt for i=1, 4 do btnx[i]=(cx[i])-w/4 btny[i]=(cy[i])-h/4 btnw[i]=b btnh[i]=a end elseif eng[3] then cx[1]=lf cx[2]=b cx[3]=rt cy[1]=tp cy[2]=bt cy[3]=tp for i=1, 3 do btnx[i]=(cx[i])-w/4 btny[i]=(cy[i])-h/4 btnw[i]=b btnh[i]=a end elseif eng[2] then cx[1]=lf cx[2]=rt cy[1]=a cy[2]=a for i=1, 2 do btnx[i]=(cx[i])-w/4 btny[i]=(cy[i])-h/4 btnw[i]=b btnh[i]=a end end if btn[1] or btn[2] or btn[3] or btn[4] then if pulse and inRect(touchX, touchY, -1, -1, 12, 13) then -- resets selected engine for i=1, 4 do btn[i]=false end end else if engn>1 then -- selects engine for details for i=1, engn do if pulse and inRect(touchX, touchY, btnx[i], btny[i], btnw[i], btnh[i]) then btn[i]=true end end end end for i=1, 4 do output.setNumber(i, cx[i]) output.setNumber(i+4, cy[i]) if btn[i] then output.setNumber(9, i) -- sets engine number for detailed view elseif btn[1] or btn[2] or btn[3] or btn[4] then -- spacer else output.setNumber(9, 0) end end end end
function inRect(x, y, rectx, recty, rectw, recth) -- checks if click is inside button return x>rectx and y>recty and x<rectw+rectx and y<recth+recty end

btn={} gen={} genn=property.getNumber("Number of Generators") stby=property.getBool("Include Standby Battery") for i=1, genn do table.insert(gen, #gen+1, true) end btnx={} btny={} btnw={} btnh={}
function onTick() go=input.getBool(32) if go then if stby then sby=2 else sby=1 end w=input.getNumber(1) h=input.getNumber(2) a=h/2 b=w/2 touchX=input.getNumber(3) -- touchscreen pixel coords touchY=input.getNumber(4) press=input.getBool(1) if press then -- pulses the screen press to prevent flickering if x==0 then pulse=true x=1 else pulse=false end else x=0 pulse=false end cx={0, 0, 0, 0} cy={0, 0, 0, 0} lf=w/4 rt=3*w/4 tp=7 bt=21 if gen[4] then -- defines center points for each generator cx[1]=lf cx[2]=rt cx[3]=lf cx[4]=rt cy[1]=tp cy[2]=tp cy[3]=bt cy[4]=bt for i=1, 4 do btnx[i]=(cx[i])-w/4 btny[i]=(cy[i])-h/4 btnw[i]=b btnh[i]=a end elseif gen[3] then cx[1]=lf cx[2]=b cx[3]=rt cy[1]=tp cy[2]=bt cy[3]=tp for i=1, 3 do btnx[i]=(cx[i])-w/4 btny[i]=(cy[i])-h/4 btnw[i]=b btnh[i]=a end elseif gen[2] then cx[1]=lf cx[2]=rt cy[1]=tp cy[2]=tp for i=1, 2 do btnx[i]=(cx[i])-w/4 btny[i]=(cy[i])-h/4 btnw[i]=b btnh[i]=a end elseif gen[1] then cx[1]=b cy[1]=tp end for i=1, 4 do output.setNumber(i, cx[i]) output.setNumber(i+4, cy[i]) end if btn[1] or btn[2] then if pulse and inRect(touchX, touchY, -1, -1, 12, 13) then -- reset button for detailed view for i=1, 2 do btn[i]=false end end else -- selects a battery for detailed view if pulse and inRect(touchX, touchY, 0, 8+math.max(cy[1], cy[2], cy[3]), h/sby, h-(math.max(cy[1], cy[2], cy[3])+8)) then btn[1]=true elseif pulse and inRect(touchX, touchY, b, 8+math.max(cy[1], cy[2], cy[3]), b, h-(math.max(cy[1], cy[2], cy[3])+8)) and stby then btn[2]=true end end for i=1, sby do if btn[i] then output.setNumber(9, i) -- outputs value of detailed battery elseif btn[1] or btn[2] then -- spacer else output.setNumber(9, 0) -- resets to main screen end end end end
function inRect(x, y, rectx, recty, rectw, recth) -- checks if click is inside button return x>rectx and y>recty and x<rectw+rectx and y<recth+recty end
